import React from "react";
import styled from "styled-components";
import { TopCarousel, carouselData, HomeShowCaseCard } from "../components";

const Home = () => {
  return (
    <Container>
      <TopCarousel data={carouselData} />
      <div className="cardContainer flex">
        <HomeShowCaseCard  />
        <HomeShowCaseCard />
        <HomeShowCaseCard />
        <HomeShowCaseCard />
      </div>
    </Container>
  );
};

export default Home;

const Container = styled.section`
  .cardContainer {
    margin-top: -300px;
    width: 100%;
    justify-content: space-evenly;
    gap: 1rem;
  }
`;
